"use strict";

function f_gold(s) {
    let pos = Array(32).fill(Infinity);
    pos[0] = -1;
    let vowels = 'aeiou';
    let state = ans = 0;
    for (let i = 0; i < s.length; i++) {
        let c = s[i];
        for (let j = 0; j < vowels.length; j++) {
            let v = vowels[j];
            if (c === v) {
                state ^= 1 << j;
            }
        }
        ans = Math.max(ans, i - pos[state]);
        pos[state] = Math.min(pos[state], i);
    }
    return ans;
}
